{"query":"query ($start: Long, $limit: Int) {
	getLiveInstrumentEvents(start: $start, limit: $limit) {
		occurredAt
		eventType
		instrument {
			id
			location {
				source
				line
				scope
			}
			condition
			expiresAt
			hitLimit
			applied
			throttle {
				limit
				step
			}
			pending
			... on LiveBreakpoint {
				variableControl {
					maxObjectDepth
					maxObjectSize
					maxCollectionLength
					variableTypeConfig {
						type
						control {
							maxObjectDepth
							maxObjectSize
							maxCollectionLength
						}
					}
					variableNameConfig {
						name
						control {
							maxObjectDepth
							maxObjectSize
							maxCollectionLength
						}
					}
				}
			}
			... on LiveLog {
				logFormat
				logArguments
			}
			... on LiveMeter {
				meterType
				metricValue {
					valueType
					value
				}
			}
			type
			meta {
				name
				value
			}
		}
	}
}
","variables":{"start":1686003517915,"limit":10}}

